import React from "react";

import "./styles.css";

/* The Header Component */
class SearchBox extends React.Component {
  render() {
    return (
      <div className = "searchDiv">
      <form id = "searchBox"class="search">
      <input id = "searchBoxInput" type="text" placeholder="Search.." name="search"></input>
      <button id = "searchBoxButton" type="submit"><i class="fa fa-search"></i></button>
     </form>
     </div>
    );
  }
}

export default SearchBox;
